export default function App(){
    let alphabets = 'abcdefghijklmnopqrstuvwxyz'
    let resarr=[]
    for(let i=1;i<=26;i++){
        resarr.add({
            value: alphabets[i],
            isClick:false,
            index: i
        })
    }
    const arrEle=resarr.map(arr=>{
        return(
            console.log(arr)    
        )
    })
    return(
        {arrEle} 
    )
}
